import React from 'react';
import AppHeader from './AppHeader';

interface Props {
  children: React.ReactNode;
}

const Layout = ({ children }: Props): JSX.Element => {
  return (
    <>
      <AppHeader />
      <div>{children}</div>
    </>
  );
};

export default Layout;
